import React, { useState } from 'react'
import navitems from '../data/navdata'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faBars } from '@fortawesome/free-solid-svg-icons'
import { NavLink } from 'react-router-dom'
const Navbar = () => {

  const [shownav, setshownav] = useState(false)

  const hidemenu = () => {
    setshownav(!shownav)
  }

  return (
    <div className=' grid  grid-cols-2  bg-slate-800 h-10 p-2 text-white'>
      <div style={{width:'42%'}}>
      <p className=''></p>  Shri Mukundraj Mobile Shopee.
      </div>
      <div className='md:hidden lg:hidden xl:hidden text-right mx-2'>
        <div className='text-right'>
          <button onClick={hidemenu}>
            <FontAwesomeIcon icon={faBars} />
          </button>

        </div>

        {
          shownav && navitems.map((item) => {
            return <div item={item} className='text-left mx-[20%]'>
              <NavLink to={item.path}>
                {
                  item.name
                }
              </NavLink>

            </div>
          })
        }
      </div>

      <div className='hidden md:flex lg:flex xl:flex'>

        {
          navitems.map((item) => {
            return (
              <div className='mx-2'>
                <NavLink to={item.path}>
                  {
                    item.name
                  }
                </NavLink>
              </div>
            )
          })
        }


      </div>
    </div>
  )
}

export default Navbar
